          <_probability_min/>
          <_probability_max/>
          <_probability_avg/>
        </_probability>
        <call id="a1" endpoint="move_down">
          <parameters>
            <label>Move down</label>
            <method>:put</method>
            <arguments/>
          </parameters>
          <code>
            <prepare/>
            <finalize output="result">data.count += 1</finalize>
            <update output="result"/>
            <rescue output="result"/>
